import { Input as NativeBaseInput } from 'native-base';

export function Input({...rest}: InputProps) {
  return (
    <NativeBaseInput 
    bg='gray.700'
    h={14}
    size='md'
    borderWidth={0}
    fontSize='md'
    fontFamily='body'
    color='white'
    placeholderTextColor='gray.300'
    {...rest}
    />
    

  );
}
